import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with longer timeout
    await page.goto(fileUrl, { waitUntil: 'networkidle', timeout: 60000 });

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Perform a search first to get to results page with price filter
    await page.waitForSelector('#searchInput', { timeout: 10000 });
    await page.fill('#searchInput', 'electronics');

    // Use the first visible search button
    await page.click('.search-btn:visible');

    // Wait for results to load and price filter to appear
    await page.waitForSelector('.price-filter', { timeout: 15000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Fill price range inputs
    await page.fill('#minPrice', '50');
    await page.fill('#maxPrice', '200');

    // Click apply filter button
    await page.click('.apply-filter');

    // Wait for results to update
    await page.waitForTimeout(3000);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_filter_applied.png'));

    // Extract filter results
    const productCount = await page.$$eval('.product-card', cards => cards.length);
    const productPrices = await page.$$eval('.product-price', prices => 
      prices.map(p => parseFloat(p.textContent.replace('$', '')))
    );

    return {
      success: true,
      action: "Applied price range filter of $50-$200 to electronics search results",
      extractedData: {
        productCount,
        priceRange: { min: 50, max: 200 },
        productPrices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
